INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (0.0, 4, 4, 24015, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 1, 10021, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (4.0, 4, 1, 24016, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 2, 10021, 0.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (0.0, 4, 4, 24017, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 3, 10021, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (5.2, 1, 2, 24018, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 4, 10021, 0.0, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (4.2, 5, 6, 24019, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 5, 10021, 0.0, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (0.0, 2, 2, 24020, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 6, 10021, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (6.4, 1, 6, 24021, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 7, 10021, 0.0, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (0.0, 2, 2, 24022, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 8, 10021, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (10.08, 6, 3, 24023, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 9, 10021, 0.0, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (5.0, 1, 2, 24024, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 10, 10021, 0.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "カオリ（サマー）");
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (0.0, 2, 2, 24025, 0.0, 24, "2019/07/31 12:00:00", 110501, "2030/12/17 14:59:59", 11, 10021, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "カオリ（サマー）");
